class SilentSliderWrapper extends HTMLElement {
    isCardInit = false;
    constructor() {
        super();
    }

    set hass(hass) {
        const busElement = this.querySelector('#silent-slider-render');
        if (this.isCardInit && busElement) {
            return;
        }
        // Initialize the content if it's not there yet.
        this.innerHTML = `
          <silent-slider-render id="silent-slider-render"></silent-slider-render>
        `;


        setTimeout(() => {
            const busElement = this.querySelector('#silent-slider-render');
            if (busElement) {
                busElement.myConfig = this.config;
                this.isCardInit = true;
            }})

    }

    setConfig(config) {
        this.config = config;
    }

}

customElements.define('silent-image-slider', SilentSliderWrapper);
